import React from 'react'
import {Container ,Left ,Right ,Form ,Input ,Textarea ,P ,Button ,Title} from './style'
const Contact = () => {
    return (
       <Container>
           <Left>
              <Title>Contact Us</Title>
              <Desc>width: 398px;
              height: 76px;
              left: 165.79px;
              top: 5431px;
              
              font-family: Poppins;
              font-style: normal;
              font-weight: 500;
              font-size: 25px;
              line-height: 37px;
              
              color: #486958;</Desc>
           </Left>
           <Right>
                <Form>
                <P>
                   <Input type='text' placeholder='Full name'/>
                </P>
                <P>
                    <Input type='email' placeholder='Email address'/>
                </P>
                <P>
                  <Textarea  placeholder="Description" >
                  
                  </Textarea>
                </P>
                <P>
                  <Button>Submit</Button>
                </P>
                </Form>
           </Right>
       </Container>
    )
}

export default Contact
